import React from "react";

const SearchResult = ({data}) => {
    return (
    data.map((item) => {<div>
      <div style={{display:"flex", flexDirection:"row", justifyContent:"space-between"}}>
        <img className="profileImage rounded" src=""></img>
        <div>
          <p>{item.name}</p>
        </div>
        <a href="#">Follow</a>
      </div>
    </div>})


 );
}

export default SearchResult;
